import React from "react";
import Glass from "../img/magnifying-glass-solid.svg";

const SearchInput = () => {
  return (
    <form action="">
      <label htmlFor="">
        <img src={Glass} alt="search" />
        <input
          type="search"
          className="search__field"
          id="search"
          placeholder="Search item..."
        />
      </label>
    </form>
  );
};

export default SearchInput;
